INSERT INTO `fk_dish_items_master` VALUES (57,26,'Iced Tea Sweetened','Freshly brewed each day from a premium blend of tea leaves. Available sweetened with real cane sugar, or unsweetened. Tea is a natural source of protective antioxidants*.','0','Y'),(58,26,'Iced Coffee','Iced Coffee is handcrafted daily, made with a custom blend of cold-brewed coffee and fresh 2% milk, sweetened with pure cane sugar and served over ice. Our coffee beans are sustain-ably sourced by THRIVE Farmers, a farmer-direct coffee company that enriches the lives and communities of those who grow it. Available all day in Original or Vanilla.','0','Y'),(59,26,'Berry-Lime Liquado','Buzz fiber-rich berries up in the blender for a refreshing Mexican-style agua fresca.','0','Y'),(60,27,'Asian Salad','The strongest flavor is supplied by the chicken which is marinated and orange glazed. It was quite tender as well. There\'s enough flavor in the chicken to enjoy the salad without the dressing for healthier eating, but I love me some sesame ginger dressing so I went with a little bit less than half the dressing which is plenty.','0','Y'),(61,27,'Grilled Chicken Cool Wrap','Sizzles with the flavors of brown sugar, ginger and soy sauce.','0','Y'),(62,28,' Buttermilk Crispy Chicken Sandwich','Feel the “Loving Tender” on the front and the “Crispy. Tender. Bold. Yours.”','0','Y'),(63,28,'Spicy Chicken Deluxe Sandwich','The sandwich is inspired by Southern buttermilk fried chicken using breast meat. Rosati tested a number of techniques including marinating, grilling, and even sous vide cooking the breast before deep frying. He settled on a slow cooking method \"similar\" to sous vide cooking, using buttermilk. The three ounce breasts are cooked ahead of time and then dredged in batter and deep fried at service.','0','Y'),(64,28,'GRILLED CHICKEN CLUB SANDWICH','The sandwich improves upon their standard crispy chicken sandwich with crinkle-cut dill pickles, cucumber dill sauce, and Monterey Jack cheese.','0','Y'),(65,32,'Grilled Chicken Cool Wrap® and Chicken Salad Sandwich Tray','Grilled Chicken Cool Wrap® and Chicken Salad Sandwich Tray','0','Y'),(66,32,'Garden Salad Tray','A fresh bed of chopped Romaine lettuce, topped with shredded red cabbage and carrots, a blend of shredded Monterey Jack and Cheddar cheeses and grape tomatoes. Made fresh daily. Served with Charred Tomato Crispy Red Bell Peppers and guest\'s choice of dressing.','0','Y'),(69,33,'Sausage Breakfast Burrito','Chunks of pork sausage gently mixed with scrambled eggs, fire-roasted onions and peppers and a subtle blend of Monterey Jack and Cheddar cheeses - all wrapped in a soft flour tortilla and served with our spicy salsa.','0','Y'),(74,42,'Baja Tacos','Beer battered mahi mahi, avocado salad, chipolte creme, cilantro cabbage slaw, flour tortillas','0','Y'),(76,44,'Asian Vert','Nappa caggage salad blend, cilantro ginger vinaigerette, crispy wonton strips','0','Y'),(77,44,'Kale Ceasar','Romaine, kale, parmesan Ceasar dressing, crouton crumbs','0','Y'),(78,45,'BLT','A BLT (Bacon, Lettuce, and Tomato) is a type of bacon sandwich. The standard BLT is made up of five ingredients: bacon, lettuce, tomato, mayonnaise, and bread. The BLT evolved from the tea sandwiches served before 1900 at a similar time to the club sandwich, although it is unclear when the name BLT became the norm.','0','Y'),(81,45,'Caesar','Our version of the Classic Caesar : Kale, Romaine , Roasted Chicken, Shaved Parmesan and Croutons','0','Y'),(84,49,'2 Meat Sampler','Fresh AAA grade fish. Sliced to order. Served with Wasabi and pickled ginger.','0','Y'),(93,50,'12','22','0','Y'),(94,50,'13','13','0','Y'),(97,52,'Lobster and Crab Bisque','','0','Y'),(98,52,'Gazpacho','','0','Y'),(100,40,'asds','asdasdasdasd','0','Y'),(101,40,'qwer','qwewrqfq','0','Y'),(105,45,'TEST123','TEST 234','0','Y'),(106,48,'Tasty Burger','Delicious burger.','0','Y');
